export default class Menu extends Component {
  componentDidMount() {}

  goDesigns = e => {
      navigate(`/designs`)
  }

  render() {
    return (
<React.Fragment>
      <SubNav />

      <div>

<ul>

<button onClick={this.goDesigns}>
    DESIGN
</button>

</ul>

</div>
      </React.Fragment>
    );
  }
}
